const days = {
  "nov18": nov18,
  "nov19": nov19,
  "nov20": nov20,
  "nov21": nov21,
  "nov22": nov22,
  "nov25": nov25,
  "nov26": nov26,
  "nov27": nov27,
  "dec2": dec2,
  "dec3": dec3,
  "dec4": dec4,
};

function formatData(dayToUse) {
  const rawData = days[dayToUse];
  const answer = {};
  Object.keys(rawData).forEach((sym) => {
    answer[sym] = rawData[sym].map((bar) => {
      return{
        time: bar.t,
        price: bar.c,
        vol: bar.v,
        open: bar.o,
        high: bar.h,
        low: bar.l
      };
    });
  });
  return answer;
}

module.exports = { formatData };